import React from 'react';
import './FirmFacts.scss';
import FirmFactCard from '../FirmFactCard/FirmFactCard';

const FirmFacts: React.FC = () => {
  return (
    <div className="firmFacts-wrapper">
      <div className="firmFacts-header">
        <h2>Firm Facts</h2>
        <button className="close-btn">X</button>
      </div>
      <hr />
      <div className="firmFacts-cards">
        <FirmFactCard variant="default" />
        <FirmFactCard variant="border" />
        <FirmFactCard variant="default" />
        <FirmFactCard variant="border" />
        <FirmFactCard variant="default" />
        <FirmFactCard variant="border" />
        <FirmFactCard variant="border" />
      </div>
    </div>
  );
};

export default FirmFacts;
